I apologize for this and agree with what you said. I will jump on this and get it worked out. Quick question for you, do you by chance have a car that has a new style front defrost where there is metal in the windshield that heats the glass rather than air blowing onto the windshield? We have been running into issues with these cars as the metal in the windshield interferes with the signal from the tag. Regardless, we will figure it out. Please use the contact us email on our website and we will get some information through that to figure this out. Thanks again and we apologize for this.

John'}

{'time': 1503687391085, 'text': "Hi Jeanette, we're sorry we couldn't accommodate your rental request and are investigating the call-back situation with our team.

We try hard to work with everyone to find a great RV rental at a competitive price. We're adjusting our web site to be more clear that the discount pricing displayed is for longer term rentals (7-14 days).

Our owner is a retired Marine and son is active duty Marine, so we certainly can appreciate supporting veterans."}

